import { userLogin } from "../redux/features/auth/authActions";
import store from "../redux/store";

export const handleLogin = (e, email, password, role) => {
  e.preventDefault();
  try {
    if (!role || !email || !password) {
      return alert("Please Provide All Feilds");
    }
    console.log("Login:", e, email, password, role);
    store.dispatch(userLogin({ email, password, role }));
  } catch (error) {
    console.log(error);
  }
};

export const handleRegister = (
  e,
  name,
  role,
  email,
  password,
  phone,
  organizationName,
  address,
  hospitalName,
  website
) => {
  e.preventDefault();
  try {
    store.dispatch(
      userRegister({
        name,
        role,
        email,
        password,
        phone,
        organizationName,
        address,
        hospitalName,
        website,
      })
    );
    console.log(
      "Register :",
      name,
      role,
      email,
      password,
      phone,
      organizationName,
      address,
      hospitalName,
      website
    );
  } catch (error) {
    console.log(error);
  }
};
